import React, {Component} from 'react';
import Axios from 'axios';
import {Link} from "react-router-dom";
import {
    BrowserRouter as Router,
    Switch,
    Route,
  } from "react-router-dom";
import logo from '../../images/logo.png';
import LoginPage from "../../pages/LoginPage/LoginPage";
import SignUpPage from "../../pages/SignUpPage/SignUpPage";
import HomePage from "../../pages/HomePage/HomePage";
import EditablePage from "../../pages/EditablePage/EditablePage";
import MCPage from "../../pages/MakeConfessionPage/MCPage";

import "./NavBar.css";

class NavBar extends Component {
    render(){     
        const logout = () => {
            Axios.post("http://localhost:3001/logout", {
            })
        }

        return ( 
            <div>
                <nav className="navBar">

                <Switch>
                <Route path="/login"> 
                    <LoginPage/>
                </Route>
                <Route path="/signup">
                    <SignUpPage/>
                </Route>
                <Route path="/draft">
                    <EditablePage/>
                </Route>
                <Route path="/">
                    <MCPage/>
                </Route>
                <Route path="/">
                    <HomePage/>
                </Route>
                </Switch>
                    
                    <li>
                        <a className="options"><Link to="/"><img className="logoClass" src={logo}/></Link></a>
                    </li>
                    <li>
                        <a className="options"><Link to="/draft">Confession Draft</Link></a>
                    </li>
                    <li>
                        <a className="options"><Link to="/makeconfession">Make Confession</Link></a>
                    </li>
                    <li>
                        <a className="options"><Link to="/signup">Sign Up</Link></a>
                    </li>
                    <li>
                        <a className="options"><Link to="/login">Login</Link></a>
                    </li> 
                    <li>
                        <a className="options"><Link to="/" onClick={logout}>Logout</Link></a>
                    </li>
                </nav>
            </div>
        )
    }
}

export default NavBar;
